import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../style/header.css';
import { Link, useLocation } from 'react-router-dom';
const API_BASE_URL = process.env.REACT_APP_API_BASE_URL;

function Header() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [userLevel, setUserLevel] = useState(null);
  const [username, setUsername] = useState('');
  const location = useLocation();
  const currentPath = location.pathname;

  useEffect(() => {
    const checkLoginStatus = async () => {
      try {
        const response = await axios.get(`${API_BASE_URL}/checkLogin`);
        if (response.data.isLoggedIn) {
          setIsLoggedIn(true);
          setUsername(response.data.username);
          setUserLevel(response.data.userLevel);
        } else {
          setIsLoggedIn(false);
          setUsername('');
          setUserLevel(null);
          if (currentPath !== '/') {
            window.location.href = "/";
          }
        }
      } catch (error) {
        alert('로그인 상태 체크 중 에러 발생');
      }
    };
  
    checkLoginStatus();
  }, []);
  
  
  const handleLogout = async () => {
    try {
      const response = await axios.get(`${API_BASE_URL}/logout`);
      if (response.data.success) {
        setIsLoggedIn(false);
        setUsername('');
        setUserLevel(null);
        window.location.href = "/"; // 로그아웃 성공 후 메인 페이지로 이동
      }
    } catch (error) {
      alert('로그아웃 중 에러 발생');
    }
  };
  
  const handleLogin = async () => {
    const email = document.querySelector('input[type="text"]').value;
    const password = document.querySelector('input[type="password"]').value;
    

    try {
      const response = await axios.post(`${API_BASE_URL}/login`, {
        email,
        password
      });
    
      if (response.data.success) {
        setIsLoggedIn(true);
        setUsername(response.data.username);
        setUserLevel(response.data.userLevel);
      } else {
        alert(response.data.message); // 서버에서 받은 메시지 사용
      }
    } catch (error) {
      if (error.response && error.response.data && error.response.data.message) {
        alert(error.response.data.message); // 서버에서 보낸 에러 메시지 사용
      } else {
        alert('로그인 에러 발생');
      }
    }
  };

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand href="/">로고</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          {currentPath === '/' ? (
            <>
              <Nav.Link href="/">STUDENTS'REVIEW</Nav.Link>
              <Nav.Link href="/">WHAT IS-KTAL LIVE?</Nav.Link>
              <Nav.Link href="/">TUTORS</Nav.Link>
            </>
          ) : (
            <>
              {userLevel === 3 && (
                <NavDropdown title="관리자 메뉴" id="admin-menu">
                  {/* 내부 링크들 */}
                </NavDropdown>
              )}
              {userLevel === 2 && (
                <NavDropdown title="강사 메뉴" id="teacher-menu">
                  {/* 내부 링크들 */}
                </NavDropdown>
              )}
            </>
          )}
        </Nav>
        <div className="login button-container">
          {isLoggedIn ? (
            <>
              <span>{username}님</span>
              <Button variant="outline-success" onClick={handleLogout}>로그아웃</Button>
            </>
          ) : (
            <Form inline>
              <FormControl type="text" placeholder="아이디" className="mr-sm-2" />
              <FormControl type="password" placeholder="비밀번호" className="mr-sm-2" />
              <Button variant="outline-success" onClick={handleLogin}>로그인</Button>
            </Form>
          )}
        </div>
      </Navbar.Collapse>
    </Navbar>
  );

  };
  
  export default Header;
